    data: |
      SELECT DISTINCT col1 + 49 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 * - col0 > ( ( - col1 ) * + col2 );
  - name: tab0

outputs:
  - name: q12433.out
    data: |
      50
      70
